"line\":126},\"children\":[{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#BD976A\"},\"children\":[{\"type\":\"text\",\"value\":\"        loadingCommits\"}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#666666\"},\"children\":[{\"type\":\"text\",\"value\":\" =\"}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#4D9375\"},\"children\":[{\"type\":\"text\",\"value\":\" false\"}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#DBD7CAEE\"},\"children\":[{\"type\":\"text\",\"value\":\";\\n\"}]}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"class\":\"line\",\"line\":127},\"children\":[{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#666666\"},\"children\":[{\"type\":\"text\",\"value\":\"    }\\n\"}]}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"class\":\"line\",\"line\":128},\"children\":[{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"emptyLinePlaceholder\":true},\"children\":[{\"type\":\"text\",\"value\":\"\\n\"}]}]},{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"class\":\"line\",\"line\":129},\"children\":[{\"type\":\"element\",\"tag\":\"span\",\"props\":{\"style\":\"--shiki-default:#666666\"},\"children\":[{\"type\":\"text\",\"value\":\"}\\n\"}]}]}]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"If we run this application now in all of its glory and navigate to the projects page, we see the first 10 repositories now being loaded, and we can verify our API calls by filtering on XHR from the dev tools console:\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"img\",\"props\":{\"alt\":\"initial_repos_load\",\"src\":\"/blog/blazor-basics-series/initial_repos_load.png\"},\"children\":[]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Now, if we click on a table row, low and behold, the commit information for that repository loads, and we can again verify the network call from the dev tools console:\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"element\",\"tag\":\"img\",\"props\":{\"alt\":\"commits_response\",\"src\":\"/blog/blazor-basics-series/commits_response.png\"},\"children\":[]}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"And that folks, is our fully (read: semi) functional, external API calling Blazor application in its entirety. I want to iterate one more time, that we did not write a \"},{\"type\":\"element\",\"tag\":\"strong\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"single line\"}]},{\"type\":\"text\",\"value\":\" of JavaScript ourselves, and we've written a basic single-page application that can call a live API and dynamically retrieve and load data in response to a user's action. While it may seem like a dream, let's take a minute to discuss how we might improve this solution, and possibly leave the implementation details as an exercise for you, the reader!\"}]},{\"type\":\"element\",\"tag\":\"h3\",\"props\":{\"id\":\"improvements-to-be-made\"},\"children\":[{\"type\":\"text\",\"value\":\"Improvements to be made\"}]},{\"type\":\"element\",\"tag\":\"h4\",\"props\":{\"id\":\"exception-handling\"},\"children\":[{\"type\":\"text\",\"value\":\"Exception Handling\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"For starters, we are not handling exceptions gracefully in any manner within our project, so the first thing we would want to improve is our error handling. If the API gives us back a non-successful response code, you'll see on the page an error being thrown in the console, consequently crashing the application and forcing users to reload. Not a great user experience, so we might benefit from bulletproofing our API service to recover from those scenarios in a user-friendly manner.\"}]},{\"type\":\"element\",\"tag\":\"h4\",\"props\":{\"id\":\"state\"},\"children\":[{\"type\":\"text\",\"value\":\"State\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Next, notice what happens if you navigate away from the projects page after loading the data, and then navigate back to the projects page: the data is gone! Enter the problem of the application state. Just as applications on the server might manage a user session and store the current state of the session, we typically implement a similar process on the front as well, allowing users to navigate at will from page to page in our application, saving their interactions that alter data on a view in any way along the way to provide a seamless experience without having to reload pages, or even the application itself. There are great libraries and design patterns built to handle this, namely the Redux implementation for Blazor, \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://github.com/mrpmorris/fluxor\",\"rel\":[\"nofollow\"]},\"children\":[{\"type\":\"text\",\"value\":\"Fluxor\"}]},{\"type\":\"text\",\"value\":\". State management is an entire discussion in and of itself and a bit outside of the scope of what we've set out to conquer today. Take a look at the repository and several of the examples to get an idea of how we might implement state management into what we've built here today.\"}]},{\"type\":\"element\",\"tag\":\"h4\",\"props\":{\"id\":\"security\"},\"children\":[{\"type\":\"text\",\"value\":\"Security\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"With our current implementation, \"},{\"type\":\"element\",\"tag\":\"strong\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"anyone\"}]},{\"type\":\"text\",\"value\":\" with access to a browser could, in theory, navigate to our page and have our application send a large number of requests to the GitHub API. Thankfully, the folks at GitHub have thought ahead and rate limited unauthenticated client requests, such as the requests we're making. When interfacing with an external service, it's important to know \"},{\"type\":\"element\",\"tag\":\"strong\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"who\"}]},{\"type\":\"text\",\"value\":\" is initiating the network calls, as we have due diligence to protect not only our applications but our consumers and prosumers as well.\"}]},{\"type\":\"element\",\"tag\":\"h4\",\"props\":{\"id\":\"ui\"},\"children\":[{\"type\":\"text\",\"value\":\"UI\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"While I love Bootstrap, it's also caused \"},{\"type\":\"element\",\"tag\":\"em\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"a lot\"}]},{\"type\":\"text\",\"value\":\" of eerily similarly-looking sites on the web nowadays. We stuck with the default CSS implementation Microsoft bootstrapped for us, but we could easily swap that out for a different UI library, such as \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://bulma.io/\",\"rel\":[\"nofollow\"]},\"children\":[{\"type\":\"text\",\"value\":\"Bulma\"}]},{\"type\":\"text\",\"value\":\" with the help of \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://github.com/stsrki/Blazorise\",\"rel\":[\"nofollow\"]},\"children\":[{\"type\":\"text\",\"value\":\"Blazorise\"}]},{\"type\":\"text\",\"value\":\", or Material Design with the help of \"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://www.matblazor.com/\",\"rel\":[\"nofollow\"]},\"children\":[{\"type\":\"text\",\"value\":\"MatBlazor\"}]},{\"type\":\"text\",\"value\":\".\"}]},{\"type\":\"element\",\"tag\":\"h3\",\"props\":{\"id\":\"wrapping-up\"},\"children\":[{\"type\":\"text\",\"value\":\"Wrapping up\"}]},{\"type\":\"element\",\"tag\":\"p\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"Blazor allows us simple .NET developers an alternative to frontend development, sparring us from JavaScript with the help of WebAssembly. As a personal aside, I'm embracing Blazor with open arms. If you've ever had to develop with a modern JS framework, you're no stranger to the quirks and headaches that JavaScript, as well as NPM, can cause. With Blazor, there's finally an escape from \"},{\"type\":\"element\",\"tag\":\"code\",\"props\":{\"className\":\"\"},\"children\":[{\"type\":\"text\",\"value\":\"node_modules\"}]},{\"type\":\"text\",\"value\":\" directories containing every dependency in the observable universe, \"},{\"type\":\"element\",\"tag\":\"code\",\"props\":{\"className\":\"\"},\"children\":[{\"type\":\"text\",\"value\":\"==\"}]},{\"type\":\"text\",\"value\":\" type coercion (seriously, STOP using \"},{\"type\":\"element\",\"tag\":\"code\",\"props\":{\"className\":\"\"},\"children\":[{\"type\":\"text\",\"value\":\"==\"}]},{\"type\":\"text\",\"value\":\" - it's 2020 guys, not 1997), and the insanity of NPM (\"},{\"type\":\"element\",\"tag\":\"a\",\"props\":{\"href\":\"https://www.npmjs.com/package/is-even\",\"rel\":[\"nofollow\"]},\"children\":[{\"type\":\"text\",\"value\":\"my favorite package\"}]},{\"type\":\"text\",\"value\":\" for reference). In future posts, we'll explore Blazor in greater detail, cool libraries, and maybe some JS interop along the way. For now, happy coding!\"}]},{\"type\":\"element\",\"tag\":\"style\",\"props\":{},\"children\":[{\"type\":\"text\",\"value\":\"html .shiki span {color: var(--shiki-default);background: var(--shiki-default-bg);font-style: var(--shiki-default-font-style);font-weight: var(--shiki-default-font-weight);text-decoration: var(--shiki-default-text-decoration);}html .default .shiki span {color: var(--shiki-default);background: var(--shiki-default-bg);font-style: var(--shiki-default-font-style);font-weight: var(--shiki-default-font-weight);text-decoration: var(--shiki-default-text-decoration);}\"}]}],\"toc\":{\"title\":\"\",\"searchDepth\":2,\"depth\":2,\"links\":[{\"id\":\"adding-components\",\"depth\":3,\"text\":\"Adding Components\"},{\"id\":\"creating-application-services\",\"depth\":3,\"text\":\"Creating Application Services\"},{\"id\":\"adding-api-resource-models\",\"depth\":3,\"text\":\"Adding API Resource Models\"},{\"id\":\"improvements-to-be-made\",\"depth\":3,\"text\":\"Improvements to be made\"},{\"id\":\"wrapping-up\",\"depth\":3,\"text\":\"Wrapping up\"}]}},\"_type\":\"markdown\",\"_id\":\"content:blog:blazor-basics-calling-external-apis.md\",\"_source\":\"content\",\"_file\":\"blog/blazor-basics-calling-external-apis.md\",\"_extension\":\"md\"},\"hash\":\"COhrkb00eD\"}";

